import logo from './logo.svg';
import './App.css';
import Home from './modules/home/Home';
import MainHeader from './common/components/MainHeader';

function App() {
  return (
    <div style={{position: 'relative'}}>
      <img
        src={logo}
        className="App-logo"
        style={{position: 'absolute', zIndex: -1}}
      />
      <MainHeader />
      <Home />
    </div>
  );
}

export default App;
